INSERT INTO `Content` VALUES (70,'Contact Us','<h1>Contact Us<br /></h1>\r\nPlease fill out the form below to contact us via email:<br /><br />\r\n<table width=\"400\" cellspacing=\"1\" cellpadding=\"1\" border=\"0\" align=\"\">\r\n    <tbody>\r\n        <tr>\r\n            <td valign=\"top\">Your Name</td>\r\n            <td valign=\"top\"><input type=\"text\" size=\"40\" name=\"name\" /></td>\r\n        </tr>\r\n        <tr>\r\n            <td>Your Email:</td>\r\n            <td><input type=\"text\" name=\"email\" size=\"40\" /></td>\r\n        </tr>\r\n        <tr>\r\n            <td>Your Question or Comment:</td>\r\n            <td><textarea name=\"comment\" cols=\"30\" rows=\"5\"></textarea></td>\r\n        </tr>\r\n        <tr>\r\n            <td>&nbsp;The nature of this request:<br /></td>\r\n            <td>&nbsp;<select name=\"questionType\">\r\n            <option value=\"sales\">I\'d like more information</option>\r\n            <option value=\"support\">I need help with Punchcard</option>\r\n            <option value=\"biz\">Partner Opportunities</option>\r\n            </select></td>\r\n        </tr>\r\n        <tr>\r\n            <td>&nbsp;</td>\r\n            <td>&nbsp;</td>\r\n        </tr>\r\n    </tbody>\r\n</table>',NULL,'2006-05-23 22:30:02',NULL,47,1,NULL,NULL,'','',1,'Active'),(71,'My Punchcard Website','<table width=\"800\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n    <tbody>\r\n        <tr>\r\n            <td colspan=\"3\">Hello</td>\r\n        </tr>\r\n    </tbody>\r\n</table>',NULL,'2006-05-23 21:24:01',NULL,1,1,NULL,NULL,'','',1,'Active'),(72,'About Us','<h1>About Us</h1>\r\n<p>The Punchcard application was developed by <a href=\"http://www.netoasis.net&gt;Netoasis.net\"></a> to serve the needs of several clients. As these organizations have grown, so has the time necessitated by Human Resources staff to track all the hourly employee payroll.  We are pleased to say that the Punchcard application has dramatically reduced the amount of time to process bi-monhtly payroll in half.  As oft-hired consultants we had our own ideas about billing time and generating invoices and reports.  Thus was born Punchcard Plus allowing the ability to bill against projects, clients and budgets.</p>\r\n<p>Of course there are other time keeping systems, but we like to think ours sucks the least.</p>',NULL,'2006-05-23 20:56:25',NULL,50,1,NULL,NULL,'','',1,'Active'),(73,'Products','<h1>Products &amp; Services</h1>\r\n<p>The American Payroll Association (APA) estimates that payroll preparation using standard, paper-based timekeeping methods consumes 15 minutes per user per pay period.  For a 50 person orgranization this equates to 25 hours per pay period! Using the latest standards and processes, We have developed a flexible and fast solution to provide online time-keeping for any business.  Starting at $19.95 per month.</p>\r\n<h3>Punchard Basic includes:</h3>\r\n<ul>\r\n    <li>Online time entry available 24.7</li>\r\n    <li>Automated reminders via email</li>\r\n    <li>Wage and Overtime calculations for all 50 US states</li>\r\n    <li>Export of data in standard formats</li>\r\n    <li>HR forms (Vacation requests,, &ldquo;Missed Punches&rdquo;,, Overtime Authorization</li>\r\n    <li>Starting at $19.95 per month</li>\r\n</ul>\r\n<div style=\"border: 1px solid rgb(255, 255, 255); padding: 1em;\">Free Trial</div>\r\n<h3>Punchard Plus includes all Punchard Basic functionality plus:</h3>\r\n<ul>\r\n    <li>Project/Account/Client based billing</li>\r\n    <li>Formatted Export of data for out-of-the box integrationd with many payroll packages</li>\r\n    <li>Starting at $49.95 per month</li>\r\n</ul>',NULL,'2006-06-01 21:08:29',NULL,51,1,NULL,NULL,'','',1,'Active'),(373,'ROI Calculator','','2006-05-23 23:18:40','2006-05-24 06:18:40','',0,51,'','','','',1,''),(379,'FAQ','Test','2006-05-30 17:15:51','2006-05-31 00:15:51','',0,51,'','','','',1,''),(380,'FAQ','Test','2006-05-30 17:15:51','2006-05-31 00:15:51','',275,51,'','','','',1,''),(381,'Punchcard Basic Free Trial','','2006-05-31 16:58:53','2006-05-31 23:58:53','',0,51,'','','','',1,''),(382,'Punchcard Basic Free Trial','','2006-05-31 16:58:53','2006-05-31 23:58:53','',276,51,'','','','',1,'');
