  `Modified` tinyint(1) NOT NULL default '0',
  `CVS` varchar(50) NOT NULL default '',
  `Verify` tinyint(1) default '1',
  `Active` tinyint(1) NOT NULL default '1',
  `Created` datetime NOT NULL default '0000-00-00 00:00:00',
